import React from "react";

function Publication() {
  return (
    <>
      <div className="">
        <h1>
          <div class="row">
            <div class="col">1 of 2</div>
            <div class="col">2 of 2</div>
          </div>
        </h1>
      </div>
    </>
  );
}

export default Publication;
